xt; border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-top-style: none; padding: 0px 7px;" height="125"><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">16:40~17:20 </span></p></td><td width="254" style="border-top-style: none; border-left-style: none; border-bottom-color: windowtext; border-bottom-width: 1px; border-right-color: windowtext; border-right-width: 1px; padding: 0px 7px;" height="125"><p style="text-align:center"><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">对话二：海外并购的机遇与趋势</span></p></td><td width="150" style="border-top-style: none; border-left-style: none; border-bottom-color: windowtext; border-bottom-width: 1px; border-right-color: windowtext; border-right-width: 1px; padding: 0px 7px;" height="125"><p><strong><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">【对话嘉宾】</span></strong></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">金鑫（确定），华院数据 合伙人</span></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">潘松（确定），契阔资本 创始人</span></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">郝庆贵（确定），潍柴动力（000338）资本运营部部长</span></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">李 雄（确定），江苏开炫律师事务所创始合伙人</span></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">于强（拟），初华资本 合伙人</span></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">&nbsp;</span></p><p><span style="font-size:12px;font-family:&#39;微软雅黑&#39;,sans-serif">&nbsp;</span></p></td></tr><tr style=";height:25px"><td width="85" style="border-right-color: windowtext; border-bottom-color: windowtext; border-left-color: windowtext; border-right-width: 1px; border-bottom-width: 1px; border-left-width: 1px; border-top-style: none; padding: 0px 7px;" height="25"><p style="line-height:150%"><span style="font-size:12px;line-height:150%;font-family:   &#39;微软雅黑&#39;,sans-serif">17:20~18:00 </span><span style="font-size:12px;line-height:150%;font-family:&#39;微软雅黑&#39;,sans-serif">自由交流</span></p></td><td width="254" style="border-top-style: none; border-left-style: none; border-bottom-color: windowtext; border-bottom-width: 1px; border-right-color: windowtext; border-right-width: 1px; padding: 0px 7px;" height="25"><p style="text-align:center;line-height:150%"><span style="font-size:12px;line-height:150%;font-family:   &#39;微软雅黑&#39;,sans-serif">自由交流</span></p></td><td width="150" style="border-top-style: none; border-left-style: none; border-bottom-color: windowtext; border-bottom-width: 1px; border-right-color: windowtext; border-right-width: 1px; padding: 0px 7px;" height="25"><br/></td></tr></tbody></table><p><br/></p><p><br/></p>', '并购巡回论坛系列由并购菁英汇主要发起，将于8-10月在上海、北京、成都、杭州、深圳等5个城市举办，联合各个城市的合作伙伴，邀请并购领域的资深人士，与业内朋友一起探讨新经济常态下的并购机遇。', '2016-08-22 15:27:31', '2016-08-22 18:12:27', 6, 0, 0, 0, 0, 0, '', NULL, 4, '/14718551615.png', '/upload/activitythumb/2016-08-22/57baa93c858f9.png', 0, 1472108069, 1, 0),
(6, 2, 2, '曹麦穗', 0, '公司', '交流会', '2016-08-22 16:00:19', '福田', 1, 100, 15, 0, 3, '/upload/activitycover/2016-08-22/57baa89ec2698.jpg', '<p>流程介绍：</p><p>啊？</p><p><br/></p><p><br/></p><p>联系方式：<br/></p><p>直接来</p>', '嗯', '2016-08-22 15:27:58', '2016-08-23 10:07:06', 0, 2, 0, 0, 0, 0, '<p>大幅缩短交货风口浪尖阿萨德&nbsp;</p>', NULL, 2, '/14718572506.png', '/upload/activitythumb/2016-08-22/57baa898313ae.jpg', 2, 1471953623, 1, 0),
(7, 2, 2, '曹麦穗', 0, '公司', '聊天', '2016-08-22 16:00:13', '福田', 0, 100, 7, 0, 0, '', '<p>流程介绍：</p><p><br/></p><p><br/></p><p>联系方式：<br/></p>', '', '2016-08-22 15:30:54', '2016-08-23 10:06:47', 0, 10, 0, 0, 0, 0, NULL, NULL, 2, '/14718572477.png', '', 0, 1471937418, 1, 0),
(8, 2, 2, '并购圈', 0, '菁英汇', '并购帮', '2016-08-22 00:00:00', '荣超经贸中心', 0, 100, 32, 0, 0, '', '<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 行业标签四个字改成业务标签。其它，需要能填写的空格。机构类型加个其它</p><p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 点自己头像一直闪，无法点开</p><p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; （注册页）显示不够清晰，对应的资金业务应该要区别其他没被选择，背景或字体变颜色、放大</p><p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 对比了我们的画面显得不清晰，画质像素低的感觉</p><p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 提示晚完善个人资料应该直接跳转吧？加跳转</p><p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 日期由填写改成选择：选择到月；还有地域选择也是，所在地区也要标准化，不然可以随便填</p><p>7.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 编辑个人主页：刚刚选择了女，但一下拉页面，就被刷新回原来内容了；完成那个键应该换成保存，无论完善了多少，都可以保存，未填写的可以用提示</p><p>8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 编辑教育经历：右上角的保存和删除应该分开，把保存键放到右下角吧，不然容易点错；添加教育经历后显示保存成功，但是完善页面却还是显示未完善</p><p>9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 专家点击自己的个人主页：没有约见那个编辑文本，最下面的那个编辑个人资料不是很常用，应该换成编辑约见发布。但个人主页应该给个示范在那，不然我都不知道编辑文本发布后是什么样的，为什么我要编辑发布。</p><p>10.&nbsp;&nbsp;&nbsp; 上次说的个人主页的私信功能也需要</p><p><br/></p>', '菁英汇', '2016-08-22 17:33:25', '2016-08-23 10:57:09', 0, 100, 0, 0, 0, 0, '<p><a href="/user/home-page/18" target="_self"><embed id="xunlei_com_thunder_helper_plugin_d462f475-c18e-46be-bd10-327458d045bd" type="application/thunder_download_plugin" height="0" width="0"/>并购帮</a></p>', NULL, 2, '/14718584168.png', '', 0, 1471860007, 1, 0);
