INSERT INTO `news` (`id`, `admin_id`, `admin_name`, `title`, `read_nums`, `praise_nums`, `comment_nums`, `cover`, `body`, `is_media`, `media_pos`, `video`, `video_cover`, `mp3`, `mp3_title`, `summary`, `create_time`, `update_time`, `publish_time`, `user_id`, `source`, `keywords`, `status`, `thumb`, `is_delete`) VALUES
(1, 2, '曹麦穗', '独家|私募风暴来袭 北京证监局连开三罚单', 53, 4, 5, '/upload/newscover/2016-08-19/57b6aad7a0542.jpg', '<p style="text-align: justify; text-indent: 2em;">近日，财新记者独家获悉，北京格上理财顾问有限公司、品今（北京）资产管理有限公司、北京首证投资顾问有限公司因资金募集、合规管理、投资者适当性等问题被<a href="http://search.caixin.com/search/%E5%8C%97%E4%BA%AC%E8%AF%81%E7%9B%91%E5%B1%80.html" target="_blank">北京证监局</a>责令改正。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">北京证监局称，<a href="http://search.caixin.com/search/%E6%A0%BC%E4%B8%8A%E7%90%86%E8%B4%A2.html" target="_blank">格上理财</a>部分推介资料用词不严谨，未对个别投资者做调查问卷进行风险承受能力测试、未对部分投资者的风险识别能力和风险承担能力进行评估，未自行或者委托第三方机构对私募基金进行风险评级。此外，格上理财高管人员及股东信息变更登记不及时，部分销售人员未取得基金从业资格。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">格上理财是业内知名<a href="http://search.caixin.com/search/%E7%A7%81%E5%8B%9F%E5%9F%BA%E9%87%91.html" target="_blank">私募基金</a>管理人，成立于2007年，提供私募基金、券商集合理财产品、私募股权基金以及固定收益产品等投资顾问服务，并以私募机构及产品研究排名著称。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">品今资管网站未做前端控制即可浏览所有私募产品的净值等信息，部分推介资料用词不严谨，个别投资者未签署合格投资者或风险承受能力调查问卷、未对部分投资者的风险识别能力和风险承担能力进行评估。部分人员尚未取得基金从业资格</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">品今的资产管理规模目前已超过30亿元，以股票型、量化对冲型、产业基金型产品为主。公司总经理杨凡此前是中信建投证券人力资源部副总裁、中信建投（国际）金融控股有限公司副总裁。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">北京证监局责令格上理财和品今资管限期改正，30日内提交书面整改方案，并在90日内完成整改。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">首证投顾的违规事项主要是，在业务推广和服务中对部分客户进行误导性营销宣传情形，未严格落实信息公示和告知、投资者适当性制度要求，部分不具备证券投资咨询执业资格的人员存在向客户提供证券投资顾问服务的情形，投资顾问服务协议没有对“冷静期”内容进行约定。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">首证投顾成立于1997年，是首批获批的证券投资咨询公司，目前正在向中国证券投资基金协会申请私募基金管理人登记备案。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">北京证监局责令首证投顾改正，立即开展全面整改工作，按月报送整改进度情况，并于六个月内完成整改并提交书面整改报告。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">7月底，北京证监局向辖区各私募基金管理人下发通知，将于近期在全市范围内开展一次私募基金风险排查专项行动，并要求签署《北京地区私募基金管理人诚信合规经营倡议书》，旨在进一步摸清北京市私募基金风险底数。与此同时，江苏证监局也在7月底连续开出七张罚单，其中包括中植资本在内的七家私募因被查出不合规问题多达十多项，被采取行政监管措施。</p><p><br/></p><p style="text-align: justify; text-indent: 2em;">按照此前出台的私募行业监管新规要求，8月1日前无备案产品的私募将被注销资格。截至8月18日，本月共注销登记8248家私募基金管理人，登记在案的尚存16851家。截至7月底，已备案私募基金36829只，认缴规模7.47万亿元，实缴规模6.11万亿元。私募基金从业人员27.58万人。</p><p><br/></p>', 0, 1, '', '', '', '', '继本月初8000家私募被注销资格后，监管层加强合规检查，格上理财、品今资管、首证投顾被北京证监局责令改正', '2016-08-19 14:47:18', '2016-08-22 11:30:58', '2016-08-19 14:34:59', 0, '财新网', '私募', 1, '/upload/newsthumb/2016-08-19/57b6aad2228a7.jpg', 0),
(2, 2, '曹麦穗', '格力跨界造车 130亿收购珠海银隆', 34, 0, 0, '/upload/newscover/2016-08-19/57b6cbb8bfa85.jpg', '<p style="text-indent: 2em;">格力造车计划再进一步。8月18日晚，格力电器（<a href="http://quote.caixin.com/?zhisu&qUrl=http://thirdparty2.cnfol.com/000651J.html">000651.SZ</a>）发布公告称，拟作价130亿收购珠海银隆新能源有限公司（下称珠海银隆）100%股权，收购完成后，珠海银隆将成为格力电器的全资子公司。</p><p><br/></p><p style="text-indent: 2em;">由于本次收购重组后的协议需经深交所审核，已停牌逾半年的格力电器仍未复牌。</p><p><br/></p><p style="text-indent: 2em;">为了完成对珠海银隆收购，格力电器拟以发行价格15.57元/股向珠海银隆全体股东合计发行股份约8.35亿股。另外，公司拟非公开发行股份进行配套融资，配套募资总额不超过100亿元，将全部用于珠海银隆项目建设。</p><p><br/></p><p style="text-indent: 2em;">发行对象包括珠海格力集团有限公司、公司员工持股计划、广东银通投资控股集团有限公司等8名特定对象。其中格力集团出资41亿元认购2.68亿股，员工持股计划认购1.53亿股，总额达23.8亿元。珠海银隆第一大股东广东银通出资10亿元认购6422万股。增发完成后，格力集团持股比例不变，仍为格力电器第一大股东，持股比例为18.2%。</p><p><br/></p><p style="text-indent: 2em;">同时，珠海银隆承诺，增发后2016年度、2017年度和2018年度三个会计年度内的实际净利润分别不低于7.2亿元、10亿元和14亿元。珠海银隆2014年、2015年、2016年上半年度净利润分别为-2.66亿元、4.16亿元和3.77亿元。</p><p><br/></p><p style="text-indent: 2em;">本次收购计划于今年3月初启动，意味着格力迈步向新能源汽车产业进军。格力电器公告中称，国内空调市场已达到成熟和饱和阶段，单纯依靠单一产业实现进一步大幅增长的空间有限。</p><p></p><p><br/></p><p style="text-indent: 2em;">中国家电行业的主要企业都在寻求通过外延并购进行业务扩张。</p><p><br/></p><p></p><p style="text-indent: 2em;">8月16日，长虹宣布与ABB达成战略合作，进军工业机器人领域。8月8日美的集团发布公告称，收购德国库卡的额外要约收购期已经结束，美的现已持有库卡近95%股份。库卡是德国工业机器人巨头。</p><p></p><p style="text-indent: 2em;">格力计划收购的珠海银隆是一家主要生产销售纯电动客车的公司，从事锂电池以及新能源汽车的研发、生产和销售等业务。珠海银隆官网显示，截止2015年底已分别在广东珠海、河北武安及石家庄建成三大生产基地，实现新能源汽车销售订单7000辆，其中完成生产纯电动客车3189辆，其纯电动客车年销量全国排行第七。</p><p><br/></p><p style="text-indent: 2em;">新能源汽车产业目前仍然主要依靠国家和地方政府补贴拉动，珠海银隆对于政府补贴依赖度也较高。格力电器收购公告显示，因国家及地方财政补贴延迟发放，珠海银隆应收账款大幅度上升。2014年末、2015年末和2016年6月末，珠海银隆的应收账款账面余额分别为3亿、31.8亿、47.7亿元，占当期营业收入的比例分别为86.60%、82.35%和192.10%。</p><p><br/></p><p style="text-indent: 2em;">近期国家层面酝酿对新能源汽车系列产业政策进行调整，工信部已于8月12日公布了关于新能源汽车企业及产品准入的征求意见稿。消息人士称，新能源汽车补贴标准也将进行调整。</p><p><br/></p><p style="text-indent: 2em;">格力电器最新半年报显示，公司2016年1至6月实现营业收入491.83亿元，同比下降1.85%；实现净利润64.02亿元，同比增长11.92%。上半年公司主营业务毛利率为38.71%，同比增加8.12个百分点。</p><p><br/></p>', 0, 1, '', '', '', '', '格力电器拟作价130亿收购珠海银隆新能源有限公司100%股权，收购完成后，珠海银隆将成为格力电器的全资子公司，目前格力股票尚未复牌', '2016-08-19 17:05:51', '2016-08-22 11:31:08', '2016-08-19 17:01:07', 0, '财新网', '格力 跨界 ', 1, '/upload/newsthumb/2016-08-19/57b6cbb5346b3.jpg', 0);
