portant; max-width: 100%; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9O9pWbtcd17TibzUHXOl9j7icyZIW8WdfnibwqKic4NBRps6nDsNgUqicARA/640?tp=webp&wxfrom=5&wx_lazy=1" width="700" _width="auto" data-src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9O9pWbtcd17TibzUHXOl9j7icyZIW8WdfnibwqKic4NBRps6nDsNgUqicARA/640?" data-w="640" data-ratio="0.5625" data-type="png" data-s="300,640"/></p><p style="padding: 0px; clear: both; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;"><img style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9picjpmuLOfO13QLs6qd3icxpVksHrt0SuSD5T3ua0Ildn1kgHrPW9L1w/640?tp=webp&wxfrom=5&wx_lazy=1" width="700" _width="auto" data-src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9picjpmuLOfO13QLs6qd3icxpVksHrt0SuSD5T3ua0Ildn1kgHrPW9L1w/640?" data-w="640" data-ratio="0.5625" data-type="png" data-s="300,640"/></p><p style="padding: 0px; clear: both; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;"><img style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9GAKic3eNKyibnAYMEbCrpVu6ianzc14oicT9rkhibicKibFsgQlnS0MInSNHw/640?tp=webp&wxfrom=5&wx_lazy=1" width="700" _width="auto" data-src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9GAKic3eNKyibnAYMEbCrpVu6ianzc14oicT9rkhibicKibFsgQlnS0MInSNHw/640?" data-w="640" data-ratio="0.5625" data-type="png" data-s="300,640"/></p><p style="padding: 0px; clear: both; margin-top: 0px; margin-bottom: 0px; white-space: pre-wrap; word-wrap: break-word !important; min-height: 1em; max-width: 100%; box-sizing: border-box !important;"><img style="margin: 0px; padding: 0px; width: auto !important; height: auto !important; visibility: visible !important; word-wrap: break-word !important; max-width: 100%; box-sizing: border-box !important;" src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9h9NfgeZEuBqus8zcQ81GB4SR3vvryIbswavaI0OlnB49u3pyK8ZYxg/640?tp=webp&wxfrom=5&wx_lazy=1" width="700" _width="auto" data-src="http://mmbiz.qpic.cn/mmbiz/RQyE6lVukFzbgv2HViczD6HYR4j7ibX3B9h9NfgeZEuBqus8zcQ81GB4SR3vvryIbswavaI0OlnB49u3pyK8ZYxg/640?" data-w="640" data-ratio="0.5625" data-type="png" data-s="300,640"/></p></section></section></section></section></section><p>&nbsp;</p><p><br/></p>', 0, 1, '', '', '', '', '对上市公司来说，用心经营企业是一方面，资本运作手段是另一方面，两手都要硬，才能造就一家牛逼的上市公司。', '2016-08-19 17:20:37', '2016-08-22 17:54:02', '2016-08-19 00:00:00', 0, 'ListCo', '并购', 1, '/upload/newsthumb/2016-08-19/57b6cf8462c3c.jpg', 0);
INSERT INTO `news` (`id`, `admin_id`, `admin_name`, `title`, `read_nums`, `praise_nums`, `comment_nums`, `cover`, `body`, `is_media`, `media_pos`, `video`, `video_cover`, `mp3`, `mp3_title`, `summary`, `create_time`, `update_time`, `publish_time`, `user_id`, `source`, `keywords`, `status`, `thumb`, `is_delete`) VALUES
(4, 2, '曹麦穗', '近期上市公司重组失败的案例及原因汇总', 37, 1, 4, '/upload/newscover/2016-08-19/57b6d0640a142.jpg', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">8月11日，金刚玻璃公告称将继续推进公司的重大资产重组事项，然而就在公告前一天公司的重大资产重组方案未获得证监会通过。金刚玻璃推进重组再一次失败。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">自6月17日关于修改《上市公司重大资产重组管理办法》公开征求意见的通知面世以来，监管层对规避借壳尤其是创业板的规避借壳以及互联网金融、VR、影视等热点概念的重组尤为谨慎。7月26日，深交所官方微博发出《落实全面监管 着力提升监管效能-深交所贯彻依法从严全面监管之三》，其重点点名对“虚拟现实”、“石墨烯”、“人工智能”、“PE+上市公司”、资本系或合伙企业入主上市公司等热点题材保持高度敏感。金刚玻璃重组失败，正是因为证监会政策趋紧而“撞上枪口”。<br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">经财致道不完全统计，自新规发布以来，已有40多家上市公司重组失败。本文主要就关于修改《上市公司重大资产重组管理办法》公开征求意见的通知面世以来，典型的上市并购重组失败的案例进行整理，以帮助理解证监会审核思路。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(217, 33, 66); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">▌ 一、金刚玻璃（300093）</strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组涉及：</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">虚拟现实和&nbsp;“PE+上市公司”&nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">金刚玻璃：发行股份购买资产并募集配套资金暨关联交易预案（摘要）</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">金刚玻璃:关于控股股东转让股份的公告</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组详情：</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">2015年9月，在金刚玻璃停牌期间，私募大佬罗伟广受让其9.86%股份成为公司的第二大股东。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">2015年11月，金刚玻璃发布的重组预案显示，其拟以14.53元每股从罗伟广等手中购买OMG新加坡100%股权，同时，拟以20.14元每股向罗伟广等对象发行股份募集配套资金不超过6亿元用于“WIFI控制权和认证、虚拟现实和增强现实、大数据分析”等方向。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">2016年1月，罗伟广再度定向受让金刚玻璃1.38%股份，成为公司第一大股东及实际控制人。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组失败原因：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 14px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">1、罗伟广的上述做法也是近两年大火的“一二级联动”打法：即PE通过举牌、协议转让、大宗交易等方式取得上市公司一定股权甚至是第一大股东股权，然后介绍资产或直接将自己控制资产通过并购重组注入上市公司，赚取多重收益。随着监管层对市值管理等行为的收紧，PE+上市公司、一二级联动等模式均遭遇政策寒流。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">2、OMG新加坡收购价值过高。重组方案披露，OMG新加坡曾于2014年10月、2015年8月、2015年10月进行过三次股权转让，对应的总估值分别约9,748万元、7.27亿元和24.5亿元，后两次转让的增值率分别为646%和237%。而本次交易对价30亿元较2014年10月的转让对价增值率接近30倍。<br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">3、业绩与高承诺不匹配。OMG新加坡成立于2013年，主要业务是为客户提供点对点的流媒体传输解决方案，2013年度、2014年、2015年1-10月内，归属于标的资产股东的净利润分别为-175万元、3430万元和6693万元。OMG新加坡成立距重组仅有两年多，承诺2016年、2017年及2018年净利润约为2.88亿元、3.2亿元及3.51亿元。<br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;重组被否理由：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">证监会以“标的公司盈利预测可实现性及评估参数预测合理性披露不充分，不符合《上市公司重大资产重组管理办法》第四条相关规定”将金刚玻璃重组方案否决。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">上市公司重大资产重组管理办法&nbsp;&lt;第一章总则&gt;范围“第四条上市公司实施重大资产重组，有关各方必须及时、公平地披露或者提供信息，保证所披露或者提供信息的真实、准确、完整，不得有虚假记载、误导性陈述或者重大遗漏。”</span><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(172, 16, 29); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;</strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(217, 33, 66); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">▌ 二、西藏旅游（600749）</strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组涉及：</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">蛇吞象跨界并购，借壳上市<br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 14px;"><span style="margin: 0px; padding: 0px; max-width: 100%; line-height: 1.75em; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">西藏旅游:发行股份及支付现金购买资产并募集配套资金暨关联交易报告书（草案）</span><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">西藏旅游:关于本次重组不构成借壳上市的说明</span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">西藏旅游:关于收到上海证券交易所对公司发行股份及支付现金购买资产并募集配套资金暨...&nbsp;西藏旅游:关于上海证券交易所《关于对西藏旅游股份有限公司发行股份及支付现金购买...</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">关于收到上海证券交易所对公司发行股份及支付现金购买资产并募集配套资金暨关联交易...终止本次重大资产重组的公告</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组详情：</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">西藏旅游拟发行股份并支付现金购买孙陶然等46名交易对方合计持有的拉卡拉100%股权，整体作价110亿元，约占西藏旅游2015年度资产总额的594%，并且交易完成后西藏旅游的控股权也变更为孙陶然和孙浩然。由于交易完成后上市公司控制权将转移至拉卡拉一方，这种蛇吞象的行为，顿时将大众的眼球集中在其是否构成借壳上市。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;重组失败原因：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">1、一致行动人之嫌。拉卡拉的第一大股东为联想控股，且联想控股说明其对拉卡拉投资为财务性投资，不谋求控制权；孙陶然为拉卡拉第二大股东，但兼具创始人和核心管理人员的双重身份；戴启军等4个主要管理层股东直接和通过持股平台间接控制拉卡拉25.86%股权。根据草案，孙陶然与该等管理层股东存在共同投资的经济利益关系，构成《收购办法》一致行动人的推定要件。孙陶然及其一致行动人持有拉卡拉的股权比例将上升为40.73%，超过联想控股持股31.38%的比例，成为拉卡拉的第一大股东。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;2、增加公司总资产，规避借壳上市。西藏旅游声称，公司向孙陶然、孙浩然及其关联人购买的资产总额占公司资产总额的93.79%，未达100%，因此不构成借壳上市。6月17日，针对规避借壳，证监会发布了《重组办法》修订意见，总资产、净资产、营业收入、净利润、股份等5个100%不能犯其一，即使西藏旅游收购拉卡拉规避了总资产100%的限定，但是其余标准很难规避。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">6月17日，针对规避借壳，证监会发布了《重组办法》修订意见，总资产、净资产、营业收入、净利润、股份等5个100%不能犯其一，即使西藏旅游收购拉卡拉规避了总资产100%的限定，但是其余标准很难规避。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">西藏旅游总资产2015年末较2015年三季末增幅高达42%。2015年3季度公司总资产13.07亿元，到第4季度总资产就突增至18.53亿元。公司总资产增加的主要原因在于四季度增加短期借款约4.18亿元，且该部分资金均以货币资金形式存在，后于2016年1月底将4亿元归还银行。西藏旅游于年末借入大量短期借款且未使用，有刻意增加公司总资产，规避借壳上市之嫌。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">终止重组理由：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">上交所分别在今年3月和5月两度向西藏旅游发出了问询函，要求上市公司解释是否构成借壳、拉卡拉业务模式、支付行业发展现状及风险、拉卡拉董事长孙浩然与戴启军等4个拉卡拉主要管理层股东是否构成一致行动人，最终西藏旅游以“当前市场环境发生变化”为由终止本次重大资产重组。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-