gin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组涉及：</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">高承诺，运营受政府政策性影响</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">华塑控股:九届董事会第二十三次临时会议决议公告</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">关于对华塑控股股份有限公司的重组问询函</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">关于终止重大资产重组事项暨公司股票复牌公告</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组详情：</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 14px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; -webkit-tap-highlight-color: transparent; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 14px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">华塑控股今年5月披露重组预案，公司拟通过支付现金方式购买曲水中青持有的和创未来51%股权，交易金额为14.28亿元。以收益法评估。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">重组失败原因：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(172, 16, 29); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">1、高承诺。和创未来承诺2016年、2017年、2018年的净利润分别达到7,000、21,000,、34,000万元，否则将作出补偿。但是其2014年度、2015年度和2016年1至3月净利润分别为-205.66万元、-4273.50万元和-64.47万元。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;2、跨界并购，政策调控影响较大。华塑控股的主营业务是建材加工、门窗安装、园林工程等，而和创未来是一家专业为大学生提供分期购物及小额现金贷款信息服务的互联网金融信息服务中介机构，致力于打造实现普惠金融、提升融资体验、具备风控能力的互联网金融信息服务平台。若此次交易完成后，华塑控股将进入互联网金融信息服务行业。但目前互联网金融行业的发展面临着监管政策的重大不确定性，未来监管政策的不断完善将深刻影响行业未来的发展方向和行业的竞争格局。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; font-size: 14px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;</span></strong></span><span style="margin: 0px; padding: 0px; font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">终止重组理由：</span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">监管政策趋紧，使得本来就打法律擦边球的互联网金融变得更加扑朔迷离，和创未来的盈利能力存在着不确定性，同时深交所审查华塑控股重组方案后，也给华塑控股发出询问函，并从交易方案、交易标的、资产评估、业绩承诺等方面提出询问，询问项多达30个。这使得华塑控股最终以“当前市场环境发生变化”为由放弃了重组，其跨界“混搭”的尝试以失败告终。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;">&nbsp;</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; color: rgb(217, 33, 66);"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;">▌ 四、其他案例</strong></span><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(0, 128, 255); box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(172, 16, 29); line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;"></strong></span><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><span style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(89, 89, 89); font-size: 14px; box-sizing: border-box !important; word-wrap: break-word !important;">篇幅原因，下面的案例一笔带过，其他主题再深入分析。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; clear: both; white-space: pre-wrap; font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; max-width: 100%; min-height: 1em; color: rgb(62, 62, 62);"><br/></p>', 0, 1, '', '', '', '', '近期上市公司重组失败的案例及原因汇总', '2016-08-19 17:25:07', '2016-08-22 17:43:53', '2016-08-19 00:00:00', 0, '财致道', '重组失败', 1, '/upload/newsthumb/2016-08-19/57b6d05bd17b2.jpg', 0);
