ing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></strong></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; orphans: 2; widows: 2; line-height: 1.75em; text-align: justify; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(220, 50, 75); font-size: 15px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><img data-s="300,640" data-type="png" data-src="http://mmbiz.qpic.cn/mmbiz_png/mgiaiayatzYabeMBkMyR0eTboneylBOqeJw1tPiaropUBC4dMT0I7z4LkBL5bMyIWt4FVrO8ficAheibC2lNyMM0ZQw/0?wx_fmt=png" data-ratio="1" data-w="605" _width="100%" src="http://mmbiz.qpic.cn/mmbiz_png/mgiaiayatzYabeMBkMyR0eTboneylBOqeJw1tPiaropUBC4dMT0I7z4LkBL5bMyIWt4FVrO8ficAheibC2lNyMM0ZQw/640?wx_fmt=png&tp=webp&wxfrom=5&wx_lazy=1" style="margin: 0px; padding: 0px; height: auto !important; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 670px; visibility: visible !important;"/></span></strong></span><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px; line-height: 1.75em;">8 月 17 日报道，中国驻澳洲大使馆警告称，</span><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px; line-height: 1.75em;">澳方否决两家中资企业对澳洲最大电网公司 Ausgrid 规模为 100 亿澳元的股权收购案，显示出「明显的保护主义倾向」，将对中国投资者的「热情造成严重影响」</strong><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px; line-height: 1.75em;">。中国大使馆指出，这是澳洲政府今年第二次拒绝中资企业收购澳洲资产，中资企业大康农业牵头的财团此前欲收购澳洲牧业公司 Kidman &amp; Co。大康农业联手上海中房置业以及澳洲当地的 Australian Rural Capital Ltd 欲以 3.71 亿澳元收购 Kidman，但被财长莫里森以不符合国家利益为由予以否决。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; orphans: 2; widows: 2; line-height: 1.75em; text-align: justify; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;">中国大使馆的声明也说，「澳方多次表明欢迎中国企业投资，但所做出的决定却全然相反」，「中方希望澳洲政府致力于为中资企业创造一个更加公平、良好且透明的贸易及投资环境。」声明指出，Ausgrid 和 Kidman 案都将对「有意赴澳洲投资的中资企业的热情造成严重影响」。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1e