55);"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;">根据公告，阳煤集团与路桥集团签署了《股份转让协议》，拟通过协议转让方式向后者转让其持有的三维华邦 100% 股权。转让完成后，路桥集团将间接持有三维华邦所持上市公司 27.79% 股权，成为上市公司间接控股股东。由于受让方路桥集团为国有独资公司，由山西省人民政府持有 100% 股份，转让完成后，上市公司直接控股股东及实际控制人未发生变更。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; orphans: 2; widows: 2; line-height: 1.75em; text-align: justify; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 14px;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p><br/></p><section class="" label="Copyright © 2015 Yead All Rights Reserved." style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; line-height: 23.2727px; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><section style="margin: 0px auto; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; border-bottom: 1px solid rgb(221, 221, 221);"><h2 class="" style="margin: 0px 0px -1px; padding: 0px 5px 6px; font-weight: 400; font-size: 16px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; border-bottom: 2px solid rgb(220, 50, 75); display: