(6, 2, '曹麦穗', '美国第二大打车应用Lyft欲“卖身” Uber CEO说：我不要', 19, 0, 1, '/upload/newscover/2016-08-22/57ba5fce2414f.jpg', '<p><br/></p><p><img src="/ueditor/php/upload/image/20160822/1471831914957416.jpeg" alt="" data-link="" style="border: 0px; vertical-align: middle; display: block; margin: 0px auto;"/><span class="img_descr" style="line-height: 20px; padding: 6px 0px; font-size: 12px; margin: 5px auto; display: inline-block; zoom: 1; text-align: left; color: rgb(51, 51, 51);"></span></p><p style="margin-top: 0px; margin-bottom: 20px; padding: 0px; line-height: 32px; font-size: 18px; font-family: &quot;Microsoft Yahei&quot;, Simsun; white-space: normal;">　　新浪科技讯 北京时间8月21日早间消息，彭博社援引消息人士的说法称，美国第二大打车应用Lyft正在寻找收购方。不过，Uber高管过去几周对投资人表示，该公司不会支付超过20亿美元的价格收购Lyft。</p><p><br/></p>', 0, 1, '', '', '', '', '彭博社援引消息人士的说法称，美国第二大打车应用Lyft正在寻找收购方。不过，Uber高管过去几周对投资人表示，该公司不会支付超过20亿美元的价格收购Lyft。', '2016-08-22 10:13:51', '2016-08-22 15:03:47', '2016-07-22 10:14:55', 0, '新浪科技', '打车软件    并购', 1, '/upload/newsthumb/2016-08-22/57ba5fd245639.jpeg', 0),
(7, 2, '曹麦穗', '出海并购日益迅猛 中资投行缺位万万不能', 18, 0, 0, '', '<p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">中国企业海外并购势头日益迅猛，不少上市公司也从观望逐渐发展成为资深买家，频繁出海以获取技术资源和优质资产，拓展其自身产业链条，“走出去”的冲动非常强烈。据普华永道统计，今年上半年，中国海外并购活动刷新纪录，交易金额同比增长近三倍。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">不过，在如火如荼的海外并购潮中，中国买家仍然遭遇诸多瓶颈。多家上市公司相关负责人透露，由于企业自身尽职调查不深、法律财务等资源整合能力欠缺以及市场理解不透，收购标的资产往往被高度溢价，收购后整合失败案例颇多，造成企业商誉减值风险加剧、亏损加大。尤其缺乏国内中介机构的辅助，令其在海外并购过程中所处地位更加被动。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">券商国际业务相关人士表示，当前中资机构在全球市场的系统性布局缺乏、跨境并购业务开展限制繁多、国际资源网络不全，的确存在服务难以匹配中方企业海外并购需求的情况，难以在跨境并购中发挥中资投行优势，无法掌握资产并购定价的主动权。不过，上述券商人士也强调，中资买家在做出海外并购决策前，还需谨慎评估和决策，降低并购不确定性风险。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">标的资产“中国溢价”高 中国买家急寻中资机构援手</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">“如果说过去我们还停留在观望犹豫不自信的阶段，现在参与海外并购市场的意愿越来越强，很多公司的专业度和能力也早就提升，加上不少成功案例的激励，大家走出去的冲动非常强烈。”一位医药上市公司董秘在某次海外并购专题培训会上坦言，近几年海外市场机会颇多，国内市场趋于饱和且竞争激烈，出海并购已经成为不少上市公司实现内部转型、寻求外部市场技术资源和优势资产以及拓展其自身产业链条的重要途径。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">普华永道8月11日发布的报告显示，中国海外并购今年前6个月的交易金额增长近3倍至1340亿美元，超过前两年中企海外并购交易金额的总和；各类型海外并购活动均有所增长，交易数量较2015年全年高出29%，并创历史新高，其中24宗交易金额超过10亿美元。普华永道认为，新纪录主要由海外并购交易带动。其中，中国化工以430亿美元收购先正达是迄今为止最大的中国企业海外并购交易。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">不过，多家上市公司相关负责人坦言，尽管对海外市场并购领域参与的心情迫切，但在实际操作过程中，仍然遭遇诸多现实的难题。“选择怎样优质标的、如何进行全方位战略方案的设计和运作、各方资源的打通和整合由谁来操作等等一系列问题都是摆在企业面前需要解决的，有时候我们会发现没有其他可借鉴的案例参考，都是需要公司内部组织专门团队对海外市场及相关产业链的资源进行评估和筛选，耗费的精力非常大。如果一个细节出现问题，整个并购计划就会流产。”深圳一家以大宗商品交易为主的上市公司负责人表示，尽管公司在海外并购领域有较多成熟经验，但海外并购遭遇的问题太多，给公司带来庞大的经营压力。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; text-indent: 2em; background-color: rgb(255, 255, 255);">实际上，在出海并购过程中，中国买家们常常因无法找到合适的中资金融机构而感觉“孤立无援”，而这也是不少公司并购进程中面临的现实难题。“从整个公司而言，国际业务的比重日益提高，企业国际化进程中特别需要金融机构的投融资支持，尤其是很多海外收购并非单个项目的收购，而是整体产业链的布局，需要中资投行机构对实际并购运作的深度参与。”国内某大型通讯科技上市公司海外业务负责人表示。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　上述公司人士坦言，在开拓海外市场和寻求资源扩张时，上市公司越来越需要提升对完整产业链的掌控能力，因此参与海外并购的中介机构其专业判断能力将非常关键。“海外并购市场不确定性高、变化快，需要中介机构帮助制定适应变化的并购策略以及资金运用方案，同时在并购标的选择上提供支撑。在海外并购过程中，除了金融服务之外，成熟的中介机构还需要深入双方的诉求，对并购的共识和信息进行统一，筛选优质资产、防范并购风险，同时帮助企业渡过并购整合的痛苦期。”</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　由于缺乏中介机构，不少上市公司在海外并购过程中往往还遭遇“中国溢价”，其并购付出的代价较高，甚至往往造成公司的亏损。“不少中国买家给海外企业留下的印象是‘人傻钱多’的印象，很多时候中国企业参与海外并购因为缺乏国际化经验、对海外市场、资源、法律、财务及人力等理解不透，尽职调查能力不足，收购的标的往往会高出行业平均价格。如果国内有专业机构可以辅助企业，那么在海外收购进程中，我们就可以通过合理的价格收购标的资产，而不受国外投行和企业的牵制。”一家科技型上市公司相关负责人表示。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　上述负责人表示，为避免“中国溢价”情况的发生，企业转而开始通过海外知名的私募机构进行合作，借助成立并购基金的方式，以海外买家身份进行收购资产的运作，“一方面海外基金的身份可以规避被当地企业高估标的资产的情况，且整合进程的速度也会加快；另一方面也可以通过成熟基金提供海外市场的各类资源。而相比而言，国内中介机构专业能力有限，提供资源不多，暂时还无法满足一些中小企业专业领域中海外并购的要求。”</p><p><br style="color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; line-height: 26px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"/></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　跨境并购业务限制繁多 中资机构布局“缺位”</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);"><br/></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　对于中国买家跨境并购中遭遇的难题，不少券商机构承认，相比国际投行机构而言，国内投行机构，无论在全球系统性布局上，还是国际资源和项目的积累上，的确存在投融资服务的供给和需求“错位”的情况，一定程度上，国内投行机构和企业一样，对海外资产收购的定价并没有太多的“话语权”。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　“即便参与到上市公司海外并购的项目中，但由于经验不足、团队专业度不够、资源不全，无法满足企业对项目筛选、海外资源相互撮合的要求，这就造成了很多上市公司跨境并购时，或者绕过中介自身成立单独部门进行运作，或者寻求外资投行的投融资支持，中方机构能够扮演的角色实际上非常薄弱。”华南某大型券商国际业务部负责人表示，在服务上市公司海外并购的进程中，券商往往提供融资和资源整合两类服务，不过从实际情况看，提供撮合的实施难度较大，券商机构大部分更倾向于投融资服务的支持。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　然而，仅仅从投融资服务方面，券商机构仍难成为中资企业“走出去”的核心支撑。“一方面，从机构风险审核的角度来看，不少企业的信用评级不高，难以快速地通过中介机构获得融资支持；另一方面，券商机构在跨境并购业务方面融资限制较多，金融产品单一，审批程序复杂，对企业跨境并购的金融支持力度不大。”另一家大型券商相关负责人表示。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　在上述机构人士看来，由于企业资质不足、融资需求较大，企业整体融资成本较高，对企业的吸引力并不大。与此同时，在很多海外收购交易案例中，中方企业为把握收购的时间窗口，往往更倾向于现金交易，外资银行的投融资支持相比更加便捷、快速，令外资机构在海外并购中占据主导地位，进而造成了中资投行机构“缺位”的尴尬局面。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　此外，中资机构布局网络不全、专业化投行服务难以跟进企业需求，也成为企业和中介机构之间形成鸿沟的重要因素。“实际上我们在香港、日本、韩国等地区的国际化业务布局已经非常成熟，旗下的团队对当地产业链和优质资产资源的熟悉度也相对比较到位，企业走出去的目标国定位在这些区域的话，相信这种缺位的情况会减少很多。”上述华南券商机构负责人表示，目前国内多数券商国际化业务的布局还远未达到全球化的布局，对于很多中资企业的要求也无法满足，需要重新制定国际化市场战略，调整角色来满足企业出海投资的多元化需求。</p><p><br style="color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; line-height: 26px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"/></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　中资买家防范并购风险 券商提速国际投融资服务</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);"><br/></p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　尽管中国企业“走出去”渐成潮流，但在跨境并购的进程中，往往由于多种因素而令收购计划折戟海外市场。据部分海外咨询机构的调查数据显示，全球海外并购案例中70%的并购案例将会归于失败，而完成的70%案例则难以达到预期目的。据麦肯锡统计，中国67%海外收购案以失败而告终。而过去几年，从国内大型企业并购效果来看，不乏出现大型企业并购海外资产两至三年后，亏损数十亿元的案例，很大程度上与并购后整合失败有关。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　“很多时候，中国企业走出去过于激进，忽视了海外市场的复杂性，没有做足功课就匆忙下决策去海外投资，但在收购海外的进程中，既可能因为不熟悉国际市场游戏规则而遭遇外方企业的敌意，同时也可能由于不熟悉当地法律法规或者文化风俗，引发舆论质疑，从而遭到各种限制，甚至令整个收购受到被动，给企业也带来不小的损失。”一位中资投行负责人对中资企业海外并购遭遇的诸多陷阱如此评述。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　上述券商人士建议，中国企业在实施海外并购战略之前，需要谨慎评估和决策，设置相关条件再进行战略实施，同时不能将海外并购资产简单理解为资产的嫁接和转移，将并购和整合分裂开来，只有充分预估风险，才能提高海外并购的成功率。“比如在海外并购过程中，可以避开对中国并不友善的国家，其收购规则也不复杂，中介机构通过帮助企业寻找优质标的、制定交易策略、提供谈判服务等方式介入交易过程，为企业在资产收购进程中掌握主动权，其标的资产最终的溢价也不会太高。”</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　在机构人士看来，券商国际化业务的拓展实际上离不开企业客户自身走出去的步伐，在海外并购领域方面，还需重新定位和布局市场，加快提升投融资服务，尤其在专业服务能力方面需要大幅提升空间，以适应当前企业出海并购的市场化趋势。</p><p style="padding: 0px; margin-top: 0px; margin-bottom: 0px; line-height: 26px; color: rgb(68, 68, 68); font-family: 宋体, sans-serif; font-size: 14px; font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; text-align: justify; background-color: rgb(255, 255, 255);">　　“与银行业相比，投资银行在交易结构的设计、财团、债券等多元化的融资上具有优势。券商机构需要加大对国际业务布局，积极创新金融合作模式，深入了解国际市场，将自身打造成投融资渠道的超级联络人，在企业出海的进程中发挥重要角色。“上述券商机构认为，在未来国际化业务的布局中，不排除和国外投行搭建合作网络的可能，通过发挥国内和国外投行各自的优势，来满足中资企业客户与海外市场对接的多元化需求，同时规避海外并购进程中的相关风险。</p><p><br/></p>', 0, 1, '', '', '', '', '不畏风高浪急 出海并购“有钱不是万能的” \r\n狙击“中国溢价” 中资投行缺位万万不能', '2016-08-22 10:17:39', '2016-08-22 15:33:57', '2016-08-22 10:13:18', 0, '中证网', '跨境并购', 1, '', 0);
