(8, 2, '曹麦穗', '独家整理 | 本周十大并购事件（8/14-8/20）', 46, 0, 3, '/upload/newscover/2016-08-22/57ba618ae4d9d.jpg', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; color: rgb(62, 62, 62); font-family: &#39;Helvetica Neue&#39;, Helvetica, &#39;Hiragino Sans GB&#39;, &#39;Microsoft YaHei&#39;, Arial, sans-serif; font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; widows: 2; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><br/></p><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; color: rgb(62, 62, 62); font-variant-ligatures: normal; line-height: 25.6px; orphans: 2; white-space: normal; widows: 2; font-family: 微软雅黑; -webkit-border-image: none; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">01</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">1.美柚完成 10 亿元融资，已拆除 VIE 回归国内资本市场</span></strong></span></p><section class="" data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; line-height: 1.75em;"></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">美柚今日确认，已于近日完成 10 亿元人民币融资，并完成对 VIE 架构的拆除，正式回归国内资本市场。美柚方面透露，由于已经实现了规模盈利，在国内资本市场属于稀缺的投资标的，所以融资进展很快，投资人认购非常积极，几乎所有老股东都参与了跟投。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">融资除了用于承接美元资本的退出外，还将用于支持公司发展。而且美柚原计划在上半年启动赴美 IPO，随后考虑到该公司的业务和用户都集中在国内，再加上当时美柚已实现盈利，可达到国内上市的要求，因此决定放弃美国 IPO，转而拆除 VIE 回归国内资本市场。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">2</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">斗鱼直播再获 15 亿元融资，凤凰资本腾讯领投</span></strong></span></p><section data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">斗鱼今日宣布，由凤凰资本，腾讯领投的 15 亿 C 轮融资已到账。截止现在斗鱼今年累计募资超过 20 亿人民币。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">2016 年 3 月 15 日，斗鱼 TV 刚宣布，完成新一轮约 6.7 亿元融资，其中，腾讯出资 4 亿人民币领投，红杉资本进行了追加投资，跟投方还包括南山资本等。斗鱼 CEO 陈少杰表示，在现有基础上把直播平台拓展为包含游戏、御宅、星秀、科技、户外、体育、音乐、影视等集众多热点为一体的综合直播平台。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 1.75em; color: rgb(89, 89, 89); word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 