17, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">永大集团拟 3 亿参购 AC 米兰，主业不振改金融</span></strong></span></p><section data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">永大集团发布公告称，FininvestS.p.A 根据协议约定将其持有的 AC 米兰俱乐部 99.93% 的股权转让给中欧体育，中欧体育将向 Fininvest 支付转让款 5.2 亿欧元，并向俱乐部提供 1 亿欧元的贷款。永大集团全资子公司永大创新拟与中欧体育参与投资总规模不超过 45 亿元人民币的产业并购基金，其中永大创新拟认缴不超过 3 亿元人民币。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">永大集团靠做永磁开关起家，一直以来，永磁开关产品都是永大集团主营业务收入和毛利的主要来源。不过，受电气开关产品行业影响，从 2012 年后，公司净利润持续负增长。永大集团逐渐开始谋变，跨界金融动作不断，永大创新于 2015 年 8 月成立,为永大集团全资子公司，主要业务包括股权投资与金融咨询等。此次投资 3 亿元参购 AC 米兰，永大集团也表示，这是公司从原有单一的永磁开关业务转变成泛金融领域的金融控股平台战略中的重要一步。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; text-align: justify; line-height: 1.75em; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">4</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">恒大再增持万科 A 股至 6.82%，已动用逾 145 亿人民币</span></strong></span></p><section data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">万科股权争夺战有升温迹象，中国恒大（03333.HK）最新披露，在上周一（8月8日）至本周一（8月15日），再合共增持超过 2.3 亿股万科 A 股（000002.SZ），涉及资金 54.6 亿元人民币，有关持股量增至 6.82%。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">恒大于过去 16 个交易日，已动用超过 145 亿元人民币，增持万科 A 股，恒大表示主要由于万科财务表现强劲，增持属公司的投资。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">《网易财经》报道，如果安邦保险没有增持，恒大的持股比例将会超越安邦，成为万科第 3 大股东。根据港交所权益披露资料，恒大及相关人士早前已持有万科超过 5.5 亿股，每股平均价 17.91 元人民币，以万科 A 股星期一收市价计算，账面盈利已接近 40 亿元人民币。不少市场人士预期，恒大在万科持股比例，增加至 1 成的机会颇大。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">另一方面，对于有报道指万科 A 将退市一事，据《中国证券报》引述接近监管部门人士表示，交易所上市规则中对「社会公众」明确含义界定，万科 A 社会公众持股比例仍有 38.6%，远未达到退市红线，市场存在误解。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">公开数据显示，截至目前，万科 A 股股东持股中，宝能系持股达 25.4%；华润集团持股 15.29%；安邦持股 6.18%，于万科复牌后有少量增持；万科事业合伙人持股（盈安合伙基金）4.43%，金鹏、德赢 1 号两个资管计划共持股 6.2%；恒大持股 6.82%。此外，中证金持股 2.99%，至于万科 H 股（02202.HK）占流通股的 11.9%。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 1.75em; color: rgb(89, 89, 89); word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-b