ox-sizing: border-box !important; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; text-align: justify; text-indent: 2em; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">8 月 17 日消息，随着锤子科技 CEO 罗永浩昨日出席酷派 cool 1 生态手机发布会，外界有不少传言称锤子或将出售给酷派的第一大股东乐视。行业分析师孙昌旭也透露，乐视还要收购一个有情怀的公司，让不少网友将目标锁定到了锤子科技身上。对此，罗永浩早间发微博进行了明确否认。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">早前，网上也流传着阿里巴巴将收购锤子的消息，记得彼时老罗还参加了 YunOS 发布会。不过，从目前老罗又出现在乐视酷派新机发布会上来看，其与阿里的 合作可能并未谈拢，在阿里和乐视之间，老罗或正在做一些考量。至于乐视收购锤子是老罗躺枪，还是确有此事，我们静待结果。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136); line-height: 1.75em;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p></section></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">6</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">深港通正式获批，资本市场双向开放翻开新篇章</span></strong></span></p><section class="" data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; text-indent: 2em; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">面对市场化和国际化的方向，资本市场以坚定的姿态再度向前迈出关键的一大步。「深港通相关准备工作已基本就绪，国务院已批准《深港通实施方案》。」李克强总理在 8 月 16 日的国务院常务会议上明确表示。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">同一日，中国证监会主席刘士余与香港证监会主席唐家成在北京共同签署联合公告，原则批准深圳证券交易所、香港联合交易所有限公司、中国证券登记结算有限责任公司、香港中央结算有限公司建立深港股票市场交易互联互通机制，这标志着深港通实施准备工作正式启动。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">而有了沪港通良好的制度、交易规则、技术系统示范，深港通正式实施前的「备战」时间明显缩短，大约需要 4 个月。这也意味着，今年年底，内地和香港两地的投资者将迎来更广泛、更深化、更融合的股票市场互联互通。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">7</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">中交建拟 6.5 亿美元收购全球最大海水淡化公司 IDE</span></strong></span></p><section class="" data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; text-indent: 2em; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(136, 136, 136);"></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">8 月 17 日报道，全球最大的海水淡化公司——以色列的 IDE 海水淡化技术有限公司收到至少三家公司的收购报价。其中，中国交通建设股份有限公司提出一个高达 6.5 亿美元的非约束性报价，在这轮的收购报价中处于领先地位。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">IDE 成立于 1965 年，专注于开发先进的海水淡化技术，在海水淡化行业规模最大、市场占有率最高。IDE 由以色列化工集团和德莱克集团共同持股，是世界上唯一一家能同时提供热法和膜法两种不同海水淡化工艺技术及设备的供应商。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">中交建成立于 2006 年，是中国第一家实现境外整体上市的特大型国有基建企业。主要从事港口、码头、航道、公路、桥梁、铁路、隧道、市政等基础设施建设和房地产开发业务，业务足迹遍及世界 100 多个国家和地区。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; text-indent: 0em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">8</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">中方对澳方否决中资企业收购 Ausgrid 提出警告</span></strong></span></p><section class="" data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; text-indent: 2em; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">8 月 17 日报道，中国驻澳洲大使馆警告称，澳方否决两家中资企业对澳洲最大电网公司 Ausgrid 规模为 100 亿澳元的股权收购案，显示出「明显的保护主义倾向」，将对中国投资者的「热情造成严重影响」。中国大使馆指出，这是澳洲政府今年第二次拒绝中资企业收购澳洲资产，中资企业大康农业牵头的财团此前欲收购澳洲牧业公司 Kidman &amp; Co。大康农业联手上海中房置业以及澳洲当地的 Australian Rural Capital Ltd 欲以 3.71 亿澳元收购 Kidman，但被财长莫里森以不符合国家利益为由予以否决。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">中国大使馆的声明也说，「澳方多次表明欢迎中国企业投资，但所做出的决定却全然相反」，「中方希望澳洲政府致力于为中资企业创造一个更加公平、良好且透明的贸易及投资环境。」声明指出，Ausgrid 和 Kidman 案都将对「有意赴澳洲投资的中资企业的热情造成严重影响」。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 1.75em; color: rgb(89, 89, 89); word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p></section></section></section></section></section></section><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px 120px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 10px; height: 10px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-50deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">9</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">格力电器130 亿收购银隆，欲破增利不增收局面</span></strong></span></p><section data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; color: rgb(89, 89, 89); text-align: justify; line-height: 1.75em; text-indent: 2em; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">经过半年酝酿，格力电器公布收购珠海银隆新能源有限公司(下称银隆)及相关定向增发的方案。格力电器将以 130 亿元全资收购银隆，并向银隆全体股东增发股份作为兑价，同时通过增发募资 100 亿元投向银隆。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">分析认为，格力通过收购银隆 ，能快速切入门槛较高的新能源领域，更希望以此转型成为「家庭能源管理系统供应商」。借着此次增发，格力电器第一第二大股东、战略投资者的股份占比将达到 33% 左右。有投资者认为，此举将能在资本市场上抵御「野蛮人」，而员工持股也将增强企业竞争力，可谓「一石多鸟」。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; text-align: justify; line-height: 1.75em; box-sizing: border-box !important; word-wrap: break-word !important;">今年 5 月，格力集团董事长董明珠就透露，对珠海银隆的收购是很具意义的，未来公司目标是要建成以家庭为中心的能源管理系统。来自珠海银隆公司官网资料显示，该公司新能源汽车和储能是其两大产业。据工信部 2016 年 6 月纯电动客车产量显示，珠海银隆以 734 辆的单月产量排名第三。</p></section></section></section></section></section></section></section></section><p><br/></p><p><br/></p><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; line-height: 25.6px; font-family: 微软雅黑; -webkit-border-image: none; box-sizing: border-box !important; word-wrap: break-word !important; background-color: rgb(255, 255, 255);"><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" label="powered by 135editor.com" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; -webkit-border-image: none;"><section class="" data-id="85635" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px none;"><section style="margin: 20px 10px 40px 20px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important;"><section style="margin: 0px 0px 0px -10px; padding: 30px 10px 5px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 85px; height: 70px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-15deg); background-color: rgb(216, 40, 33);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: inherit; box-sizing: border-box !important; word-wrap: break-word !important;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit;"><span class="" data-original-title="" title="" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: inherit; font-size: 28px;">10</span></strong></p></section><section style="margin: -70px 0px 0px; padding: 0px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; border: 0px rgb(216, 40, 33); line-height: 25px;"><section style="margin: 0px 0px -5px 100px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; width: 20px; height: 20px; box-shadow: rgb(120, 120, 120) -1px 3px 8px; color: rgb(255, 255, 255); border-color: rgb(216, 40, 33); transform: rotate(-45deg); background-color: rgb(216, 40, 33);"></section><section style="margin: 0px; padding: 80px 15px 18px; max-width: 100%; box-sizing: border-box; word-wrap: break-word !important; color: inherit; font-size: 14px; box-shadow: rgb(117, 117, 117) 0px 0px 5px; border: 1px solid rgba(117, 117, 117, 0.498039);"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; box-sizing: border-box; clear: both; min-height: 1em; line-height: 24px; color: inherit; word-wrap: break-word !important;"><span style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; font-size: 20px;"><strong style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><span class="" data-brushtype="text" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important; color: rgb(216, 40, 33); text-align: justify;">上海九百否认万达商业借壳 ：未进行过任何商谈和接触</span></strong></span></p><section data-style="line-height: 1.75em; box-sizing: border-box; padding: 0px; margin: 0px; text-align: left; color: inherit;font-size:14px;" style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">上海九百 8 月 17 日晚间发布股票交易异常波动公告，否认大连万达商业地产 股份有限公司（简称「万达商业」）欲借壳的传闻。公告称，截至目前，公司、控股股东、实际控制人未与万达商业就市场传闻事项进行过任何商谈和接触。</p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><br style="margin: 0px; padding: 0px; max-width: 100%; box-sizing: border-box !important; word-wrap: break-word !important;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;">由于上海九百股票于 8 月 15 日、16 日、17 日连续三个交易日内日收盘价格涨幅偏离值累积达到 20%，属于股票交易异常波动。经公司自查并向控股股东或实际控制人发函核实，截至公告披露日，公司、控股股东、实际控制人不存在涉及公司的应披露而未披露的重大信息或处于筹划阶段的重大事项，并承诺至少未来 3 <span style="color: rgb(62, 62, 62); orphans: 2; widows: 2;">个月内不筹划相关重大事项。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="color: rgb(62, 62, 62); orphans: 2; widows: 2;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; white-space: pre-wrap; box-sizing: border-box !important; word-wrap: break-word !important;"><span style="color: rgb(62, 62, 62); orphans: 2; widows: 2;"></span></p><p>此外公告称，2016 年 6 月，市场上曾有过万达商业欲借壳的传闻，公司已及', 0, 1, '', '', '', '', '独家整理 | 本周十大并购事件（8/14-8/20）', '2016-08-22 10:21:40', '2016-08-22 14:55:59', '2016-08-22 00:00:00', 0, '并购菁英汇', '周报', 1, '/upload/newsthumb/2016-08-22/57ba6185d34d0.jpg', 0);
INSERT INTO `news` (`id`, `admin_id`, `admin_name`, `title`, `read_nums`, `praise_nums`, `comment_nums`, `cover`, `body`, `is_media`, `media_pos`, `video`, `video_cover`, `mp3`, `mp3_title`, `summary`, `create_time`, `update_time`, `publish_time`, `user_id`, `source`, `keywords`, `status`, `thumb`, `is_delete`) VALUES
(9, 2, '曹麦穗', '深港通开通在即 谁是深市的港资“最爱”', 227, 0, 4, '/upload/newscover/2016-08-22/57ba64a71c9c7.jpg', '<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　上周，被期待已久的深港通获批。深港通无疑是沪港通的加强和升级，因为双向可以交易的股票增加了不少。大约四个月后，深港通就将正式开通。投资者更关心的无疑是怎样利用深港通的历史时机，寻找获取收益的机会。每经投资宝将为您梳理出深港通投资的三大主线，不仅覆盖了A股及H股，还通过历史数据剖析出港资的投资手法及投资习惯。港股市场是机构投资者主导的市场，此前通过沪股通投资A股的也多是机构投资者，他们的投资更多是基于基本面的分析和研究，而且他们参与资本市场的时间相对也更长，因此需要重点关注他们的投资方式。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　【“大块头”股价创新高，港资用行动证明A股也适合长期投资】</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　长久以来，很多投资人认为A股只适合短线炒作、概念炒作，像股神巴菲特那样的价值投资并不一定适合A股市场。不过，在2014年11月沪港通开通后，港资爱买的股票及其投资习惯一下子呈现在A股投资者面前。甚至沪股通的资金流向都成为A股投资的一大重要参考指标。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在近两年的时间里，港资投资的A股基本还是大市值公司，而且这些公司基本都是在各自行业中的领先企业，甚至是行业龙头。一香港著名策略分析师告诉每经投资宝，“香港机构投资A股的特点就是持续投资，并注重高抛低吸。”</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　虽然有投资者觉得买A股蓝筹股涨得慢，但有趣的是，在港资特别青睐的沪股通20余只股票中，有超过三分之一的股票近期都创出新高，这不得不让人感叹。他们用实际行动及战绩证明：其实A股也是进行长期投资的好地方。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　8大港资爱股创新高</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　经常查看沪股通十大成交活跃股名单的投资者会发现，其实经常上榜的股票基本都是熟面孔，如：贵州茅台、中国平安、伊利股份等大市值股票。而且港资也常随着市场的波动而流出或流入。不过随着沪股通额度逐渐被使用，总的来说港资还是在净买入A股。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　每经投资宝统计了沪港通开通以来港资净买入超过5亿元的个股后发现，总共有21只股票上榜(中国北车因为退市没有纳入统计)。上述股票中，贵州茅台被净买入最多，达到了121.93亿元；安信信托被净买入最少，为5.3亿元。(数据来自国联证券研究所)</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　作为被净买入最多的贵州茅台，其实最有代表性。从沪港通开通之初，贵州茅台就在被港资买进。2014年11月17日，贵州茅台的收盘价为139.96元，而上周五贵州茅台报收于306.48元(本文股价均前复权处理)，股价成功翻倍。甚至在今年7月7日，贵州茅台还上涨至历史新高326.8元。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　事实上，作为白酒行业的龙头，看好贵州茅台的，除通过沪股通进入的港资外，外资同样觊觎不已。每经投资宝注意到，据贵州茅台一季报显示，截至2016年3月31日，香港中央结算有限公司(就是沪股通港资)在增持贵州茅台的股票，持股数占总股本比例达5.78%。此外，三只QFII基金GIC PRIVATE LIMITED(新加坡政府投资有限公司)、易方达资产管理(香港)有限公司、奥本海默基金公司均为贵州茅台前十大股东，持股比例分别达1.35%、1%和0.58%。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　除贵州茅台外，恒瑞医药的走势同样值得称赞。近期才进入“千亿市值俱乐部”的恒瑞医药，股价走势同样给人穿越牛熊的感觉，其股价在今年8月15日才站上历史新高45.88元。如果从2014年11月17日的收盘价24.14元算起，目前的股价同样是接近翻倍。沪股通资金净买入恒瑞医药的金额达14.26亿元。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　与贵州茅台情况相似，恒瑞医药前十大股东名单中，除港资通过沪股通进入外，两只QFII基金同样在列——高瓴资本管理有限公司、挪威中央银行分别持有恒瑞医药0.85%和0.81%的股份。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　据每经投资宝不完全统计，在沪股通净买入额超过5亿元的个股中，与贵州茅台、恒瑞医药情况类似的股票还有6只，分别是长江电力、伊利股份、上汽集团、浦发银行、宇通客车和福耀玻璃，不少个股近期创出新高，没创新高的也接近新高。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　稀缺龙头更易受青睐</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　说到沪港通开通后港资的购买习惯，对沪股通港资净买入金额超过5亿元的21只股票进行分析不难看出，港资还是偏好业绩好、市值大、估值合理的行业龙头股。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　据国联证券提供的数据显示，在上述21只股票中，市值最大的是中国平安，达6047亿元，市值最小的安信信托也有348亿元；从估值角度看，市盈率最低的是兴业银行，仅为5.97倍，市盈率最高的是恒瑞医药，为38.3倍；从行业角度看，金融业绝对是占了大头，在上述21只股票中，有8只金融股，涵盖银行、保险、信托、券商等金融细分行业。值得注意的是，港资在选择银行股时，主要买进了多只全国性股份制银行的股票，而工农中建四大行却没有成为港资买进的重点。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　除金融股外，港资瞄准了稀缺股，如食品饮料行业中的贵州茅台和伊利股份。交运、公用事业及建筑装饰行业也成为港资买进的重点，这些行业中有5只股票净买入超过5亿元，分别是长江电力、海螺水泥、大秦铁路、上海机场和中国建筑。另外，汽车股有3只股票净买入额超过了5亿元，上汽集团、宇通客车和福耀玻璃分别上榜。商品贸易板块的小商品城同样上榜。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　从上述创新高及接近新高的8只股票看，三只汽车股全部在其中，两只食品饮料股也都在其中，医药股、金融股和公用事业股各一只进入新高名单。因此，如果是港股稀缺的行业并处于行业领先地位(甚至是行业龙头)则更容易表现优异。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　【深港通开通在即，谁是深市的港资“最爱”】</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在沪港通开通后，深港通就一直被市场预期，而深港通的题材也被炒了一波又一波。上周证监会终于公布了深港通的细节，并且大约在4个月后深港通就会正式开通。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　据深港通的细节显示，将有近900只深市A股进入深股通标的，这一数量高于沪股通标的的数量。而投资者最关心的是，港资将会重点买进哪些个股？事实上，每经投资宝已经找出了港资最爱的沪市个股，而相关个股股价的上涨也证明了港资独到的眼光。因此，依葫芦画瓢根据港资的购买特点和习惯，寻找出他们喜欢的深市个股。需要注意的是，由于深股通中有很多中小板及创业板个股进入了投资标的，这也是以前沪股通所没有的全新情况。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　“稀缺性”是港资投资焦点</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　沪股通里的明星股，毫无疑问就是贵州茅台，不仅港资净买入金额排名第一，而且股价表现优异，屡创新高。每经投资宝注意到，一方面，贵州茅台基本面的确优良；另一方面，贵州茅台近4000亿元的总市值使其成为白酒饮料行业的老大。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　同属沪市白酒行业的口子窖，虽然对港资来说也属稀缺行业，但其200亿元的市值与行业龙头还是相差太多。而深市中的五粮液和洋河股份名列行业第二和第三，市值分别达1352亿元和880亿元，行业排名及市值均远高于口子窖。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在沪股通净买入较多的家电行业股里，只有一家——青岛海尔，但其市值在A股家电行业里只能排到第三名，因为该行业的龙头及第二名都在深市：美的集团和格力电器分别以1796亿元及1066亿元的总市值远高于青岛海尔628亿元的总市值。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　与家电行业情况类似的是医疗行业，在沪股通净买入超5亿元名单中，恒瑞医药作为唯一的医药股上榜。而市值排名医药股第三和第四的康美药业和上海医药却没有上榜。值得注意的是，恒瑞医药以总市值1044亿元排名医药股第二名，而深市的上海莱士以1047亿元的市值成为医药股龙头。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　沪股通标的中，金融股，特别是银行股，极受港资青睐，有四只全国性股份制银行分别被净买入超过15亿元，有点资金被平均使用的意味。而在深市，全国性股份制银行标的并不多，平安银行算一家。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　需要注意的是，有三只汽车概念股的沪股通净买入额超过了5亿元，而且这三只股票在近期都创出新高或者逼近新高，走势极为强劲。深市超过500亿元市值的汽车股就有两只——比亚迪和长安汽车的总市值分别为1633亿元和749亿元。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　作为少有的机场股，上海机场也被港资净买入较多。同样作为机场股，深市的深圳机场也是为数不多的机场股之一。但需要注意的是，深圳机场的市值仅190亿元。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　广发证券认为，与沪港通一样，深港通开通后港资依然会优先选择业绩好、市值大、估值合理的行业龙头股。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　避免三大投资误区</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　深港通开通后，将有近900只个股成为港资可交易的标的股票。有一些看似合理的投资逻辑，其实事实并非如此，有三大误区需要投资者格外注意。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　误区一：买入高股息率的沪市A股。市场上有观点认为，香港市场利率水平较低，高股息率的股票对香港投资者来说具有吸引力，而高股息率的沪股通标的股票会因沪港通的推出而体现出相对优势。对此，广发证券对沪港通宣布开通后不同股息率的沪股通标的股票进行检验，结果是股息率在1%~3%的股票表现最好，股息率在5%以上的股票走势反而最差。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　误区二：只要是稀缺标的就买入。虽然白酒、医药等稀缺行业的股票走势优异，但并非所有稀缺行业的股票都会受到港资青睐。事实上，军工股表现很好，但是港资却配置得很少，没有一只军工股的沪股通净买入额超过了5亿元，有色及农业板块买入更少。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　误区三：深市的中小盘股会迎来机会。深市的个股普遍市值较沪市个股小，沪股通由于标的的限制，阻碍了港资投资中小盘股，而深股通则提供了这个机会。但其实沪股通标的中一样有大把的小市值股票，上证380指数成分股中，明星电力的市值仅42.18亿元，低于100亿元市值的个股也达138只，但是这些股票还是很少能成为沪股通十大成交活跃股里的常客。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　广发证券认为，总体来说沪港通的推出对沪股通标的的股票实际影响较小，更多的是成为短期炒作的催化剂，而不是推动标的股票股价上涨的主要动力。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　【投资空间有多大，细数沪深两市AH股四大不同】</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　深港通开通之后，首选股票池就是深港两地上市的AH股。如果参照沪港通的情况，AH股之间的价差似乎不一定能缩小，炒作空间似乎有限。那么，深港通增加的AH股标的，还值得投资者关注吗？</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　每经投资宝记者注意到，与沪港通不同，深港两地上市的AH股，不仅数量少，且不少股票市值小，行业相对更为分散。因此，沪港通的经验不一定能够全盘照搬，深港通蕴含的机会，仍然值得投资者探究。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　标的数量少、溢价率更高</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　数据显示，深港两地同时上市的AH股目前有17只，远远少于沪港两地上市的70余只标的，这使得深港通增加的可交易AH股有了稀缺的意味。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　但深港通的开通时点，与沪港通已经大不相同，市场情况也发生了巨大的变化。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　沪港通开通之前，由于沪港两地上市的AH股，有很大一部分为金融股，因此有不少A股相对H股有折让。长城证券称，沪港通开通之前，AH价差处于“相对合理水平”，2012年至2013年，恒生AH股溢价指数维持中枢100左右波动，2014年初，AH股溢价指数甚至处于近5年来的低点，A股相对港股总体折价。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　目前，17只深市AH股全部处于溢价状态。按照元大证券的统计，截至8月16日，溢价率最高的是浙江世宝，溢价率382%；接下来是山东墨龙和东北电气，A股溢价率分别为248%及184%。也就是说，这些个股中，A股比H股贵了至少近两倍。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　此外，新华制药、海信科龙的溢价率都超过了150%，万科A股溢价率也达54%。整体来看，A股溢价率低于40%的个股为数寥寥，仅有广发证券、鞍钢股份、比亚迪和潍柴动力4只个股。其中潍柴动力是溢价率最低的A股，溢价6.21%。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　港交所行政总裁李小加就曾表示，虽然AH股票交易的标的同股同权，但由于两地市场无法自由流动，交易受到两个市场不同供求关系的影响，未来大的趋势是价差会越来越小，但不会消失，直至出现有效的套利机制。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　事实上，从AH溢价指数也可以看出这一点。沪港通在2014年11月17日开通，当时的AH溢价指数为102.14，两地价差并不明显。但一年之后的2015年11月16日，AH溢价指数为141.74，换言之，A股整体比H股贵了四成。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　市值更小、行业更分散</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　深市的AH股与沪市最大的不同，恐怕就是市值。记者注意到，在深圳上市的AH股中，有不少是中小板个股，占据了深市AH股数量的近三分之一。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　以浙江世宝为例(东方财富通数据)，其股本结构为：流通受限的股份为1.32亿股，而全流通股中，A股9718.6万股，占比52.85%；H股8671.4万元，占比47.15%。以8月19日的收盘价计算，浙江世宝A股的流通市值仅41.24亿元，而H股的流通市值更是区区9亿港元；山东墨龙的A股流通市值仅有30余亿元，H股流通市值不足9亿港元。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　也许正是因为深市的小市值个股更多，因此深市AH股的A股溢价普遍更高。因此，这些小盘股在深港通消息宣布前后，表现都非常活跃。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　元大证券研报显示，虽然港股市场相对深圳市场估值较低，但港股的市场活跃度却远低于A股市场，由于港股市场成交量较小、长期交投不活跃、市场缺乏流动性，因此相对而言，交投活跃的A股仍然较港股有吸引力，特别是深圳股市，其日成交量约达到沪市的2倍，港股的11倍左右，深圳股市相对港股的较强流动性成为其优势所在。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　此外，深市AH股还有一大特色，就是行业更为分散。与沪市AH股中金融股占据很大比例不同，深市的AH股中，金融股仅有广发证券一家，其余标的分布在房地产、汽车、机械设备、通信、医药生物及环保等领域中，其中不少身处曾经炙手可热的市场焦点行业。比如身处通信行业的中兴通讯、身披环保概念的东江环保、比亚迪等。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　【沪港通经验告诉你：交易深市AH股要摒弃这些执念】</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　深市AH股尽管有多个方面与沪市AH股不同，但同属两个市场的互联互通，沪港通开通前后的市场表现，或许对深港通有一定借鉴意义。而了解一些已经被沪港通证伪的“执念”，能让投资者在投资深市AH股之时，少走一些弯路。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　执念一：AH差价会缩小</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在沪港通开通之前，不少投资策略都建议投资者关注相对于H股有折价的A股，其投资逻辑是：A+H股两地上市的股票，理论上应该同股同价，AH股价差会逐渐缩小。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　事实上，沪港通宣布当天，高折价的A股确实涨幅明显，折价在20%以上的股票，包括海螺水泥、鞍钢股份、潍柴动力、中国铁建等，当天几乎都接近涨停，投资者难以参与，后续又在两三个交易日后开始回落。如果没有在第一时间买入而是追涨买入，反而会成为接盘者。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　广发证券研报将沪市AH股划分为三组：低折价A股(折价0~10%)、低溢价A股(溢价0~50%)和高溢价A股(溢价超50%)，其追踪结果显示，临近沪港通开通前两个月，高溢价的A股组合成为表现最好的一类股票，而高折价A股组合反而成为表现最差的一组。将时间拉得更长些来看，沪港通开通后1年内，无论在牛市还是股市大跌时期，折价A股组合的走势都不如溢价A股组合。高溢价的A股组合反而是走势最好的一组。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　而沪港通开通一年后，AH溢价指数从102上升到142，也再一次证伪了“AH差价会缩小”的投资逻辑。因此，在深港通消息落定后，多数机构对于AH差价收窄并不抱太大希望。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　执念二：跟着港资买大盘股</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在沪港通开通之初，市场上就有“大盘蓝筹股的春天要来了”的声音。原因很简单，秉承价值投资的港资，更重视企业的基本面和业绩。因此，已经得到广泛认可的大盘蓝筹股，也会得到港资的青睐。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　但事实上，在沪港通开通前后，大盘蓝筹股的表现并未跑赢行业平均水平。广发证券研报显示，沪港通宣布后3个月内，市值5000亿元以上的大盘股走势最优，但3个月后，市值在100亿元以下的沪股通股票反而表现更好。而在沪港通正式开通后，表现最好的一组则是市值在500亿~1000亿元之间的股票，该区间股票表现远超行业平均水平；而5000亿元以上的股票开通后3个月内则勉强在行业平均水平附近波动，股市大跌前后则远不如行业平均水平。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　因此，并不是市值越大，越容易得到港资青睐。其实，就深港通宣布之前的相关个股表现，也同样能说明问题。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　每经投资宝记者注意到，在深港通消息宣布前5个交易日，深港两地上市的AH股均出现了大幅上涨，涨幅最大的都是小市值个股。截至8月16日(深港通宣布当日)，有多只个股在5日内涨幅超20%，且多是在深圳中小板上市的AH股。这些个股的A股溢价率均很高，似乎没有更多炒作的理由，但事实上，这几只中小板AH股的涨幅，反而在深市AH股中名列前茅，而且，比“更便宜”的H股涨幅更高。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　执念三：不畏追涨概念股</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　另外，投资者还需要注意，A股市场往往有“利好出尽是利空”的解读，因此，如果在消息公布之时已经大涨后，如果坚持追涨，可能就是股价开始回落之时。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　以海螺水泥为例，在沪港通消息宣布当日股价涨停，但此后五日便将涨幅抹去。在沪港通正式开通前的15个交易日，海螺水泥A股股价上涨了9.81%，但在开通当日和次日，便分别下挫2.7%及2.48%。而在沪港通开通一周年的区间内(2014年11月17日至2015年11月17日)，海螺水泥股价仅仅上涨了1.23%，而同期大盘涨跌幅为45.42%。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　同理，在深港通消息发布及正式开通前后，类似的故事可能还会继续上演。投资者在选择标的的时候，一定要重视“择时”的重要性。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　【港股通新增上百家小市值股票，谁会成为下一个腾讯】</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　市场普遍认为港股是被低估的价值洼地，事实上，在上百只新增加的深港通下港股通的港股标的中，很多是内地投资者喜爱的类型，如科技网络股、体育股等。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　每经投资宝注意到，在沪港通开通时，腾讯控股的股价还是每股130港元(前复权)，目前已经突破200港元，并创下历史新高。那么深港通开通后，谁会成为下一个腾讯？</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　新增109家小市值股票</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　证监会表示，深港通下的港股通的股票范围是恒生综合大型股指数的成分股、恒生综合中型股指数的成分股、市值50亿元港币及以上的恒生综合小型股指数的成分股，以及香港联合交易所上市的A+H股公司股票。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　相对于沪港通下的港股通，深港通新增加的标的主要就是市值50亿港元及以上的恒生综合小型股指数的成分股。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　由于50亿港元市值的要求，所以新增标的会因个股市值变化而有一定的出入。截至上周五(8月19日)收盘，每经投资宝记者统计共有109家恒生综合小型股指数的成分股市值在50亿港元以上。大多数公司的市值并不大，超100亿港元市值的仅14家。其中市值最大的是223亿港元市值的中国民生金融，市值最小的是50亿港元的IGG。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　对于新增的这些小市值港股，申万宏源表示，内地有规模可观的资本希望配置香港的成长股，他们更看重香港成长股的配置机会(倾向于买入并持有)而不是短期的交易机会。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　值得注意的是，对于深港通下港股通50亿港元市值的要求，市场上有分析认为50亿港元市值的入选要求带来了一种投机机会：资金可以把不够50亿港元的公司抬到50亿港元以上入选深港通，吸引内地增量资金。但是这么做实际上会有两个风险，一是纳入深港通之后是否会有内地资金支持(因为股价抬升也同时拉高了其估值水平)，二是需要将市值维持在50亿港元以上多久才能纳入深港通标的。因此，申万宏源建议投资者在进行港股小盘成长股投资时，需关注公司的基本面是否能够支撑市值的扩大。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　对于深港通题材的炒作，实际上已经炒过不止一波。之前是科网股，近期一些体育概念股及地产股则表现极为优异。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　作为内地耳熟能详的老牌体育运动服饰企业李宁在今年5月30日以后，股价持续上涨，在两个多月时间里，股价大涨57%。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　361度自今年7月初开始上涨，在一个多月时间里上涨了近两成。此外，同为体育概念股的中国动向、匹克体育等股价也有类似的良好表现。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　除了体育概念股，港股中的小盘地产股近期同样是市场的亮点。宝龙地产从5月至今涨幅已达46%。此外，其他的地产股如旭辉控股集团、金地商置、花样年控股等，都有不错的表现。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　对于目前港股的情况，申万宏源表示：“短期来看，市场对深港通预期已经在近阶段得到充分反映，短期获利了结的风险较大。从长期的角度来讲，深港通会改变港股成长股的现状。”</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　内地知名企业回归投资视野</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在这109只小市值港股中，有很多个股内地投资者都不陌生。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　首先，面向大众的体育品牌认知率最高，特步国际、李宁、中国动向(KAPPA在中国的经营方)、匹克体育、361度等都是内地体育用品市场的主力。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　其次是大型知名企业的关联公司，如：中国民生金融、上海石化、恒大健康、TCL通讯、酷派集团、花样年控股、绿地香港、招商局置地、华谊腾讯娱乐、中广核新能源等。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在港股市场，腾讯可以说是一个标杆，不仅市值大，增长快速，还是恒生指数占比最大的权重股。其实在港股市场，还有众多小市值的科技网络股，虽然目前股价有所回落，不过在之前一段时间就被深港通预期炒作了一轮，加之内地投资者也偏好新兴产业，因此港股小市值科技网络股绝对值得关注。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在上述109只恒生综合小型股指数的成分股里，网龙、IGG都是从事网游及互联网相关服务的科技公司。天鸽互动(01980，HK)则从事目前很火热的在线直播业务。</p><p><br/></p>', 0, 1, '', '', '', '', '　　纵观资本市场历史上每一次大事件，其背后都会孕育出众多的投资机会。2014年开通的沪港通，让买腾讯的内地投资者和买贵州茅台的香港投资者赚得盆满钵满。', '2016-08-22 10:32:19', '2016-08-22 20:16:12', '2016-08-22 00:00:00', 0, '中证网', '深港通', 1, '/upload/newsthumb/2016-08-22/57ba648e42e66.jpg', 0),
(10, 2, '曹麦穗', '又来？中资欲买英超豪门利物浦！', 13, 0, 0, '/upload/newscover/2016-08-22/57ba9ac91c9c3.jpg', '<p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">8月21日消息，据《金融时报》报道，接近此次磋商的人士消息称，老牌英超豪门利物浦的美国老板已经聘请了经济顾问，认真考虑中国财团的收购报价。</p><p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">利物浦足球俱乐部的老板Fenway体育集团主席John W Henry已经聘请了投行Allen &amp; Co的经济顾问，就中国财团收购这支英超老牌劲旅大量股份的事宜提出建议。如果此项收购案最终达成，这将成为中国投资欧洲足球俱乐部中最重大的一笔交易。</p><p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">据悉，该财团由中国光大集团和私募股权集团PCP Capital Partners组成。</p><p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">PCP Capital Partners此前参与了阿布扎比曼苏尔财团收购曼城的交易，目前合同的细节尚不清楚，但财团意图买下这家英格兰久负盛名俱乐部不少股权份额。</p><p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">本周早些时候利物浦主席Tom Werner曾坚称俱乐部是非卖品，而首席执行官Ian Ayre表示，俱乐部并没有与任何人对投资事宜进行讨论。</p><p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">利物浦足球俱乐部是英格兰足球超级联赛的球队之一，于1892年3月15日成立，是英格兰传统豪门。利物浦是英格兰足球历史上最成功的俱乐部之一，共获得了18次英格兰顶级联赛冠军，7次英格兰足总杯冠军，8次英格兰联赛杯冠军。在欧洲赛场上，利物浦是英格兰最成功的俱乐部，5次欧洲冠军杯冠军，3次欧洲联盟杯冠军，创造了英格兰纪录。值得一提的是除了顶级联赛和英格兰足总杯外，其他的均是英格兰联赛的最高纪录。2015世界足坛俱乐部价值排名第8位。</p><p style="font-family: &#39;Microsoft Yahei&#39;, 寰蒋闆呴粦, Tahoma, Arial, Helvetica, STHeiti; padding: 0px; margin-top: 20px; margin-bottom: 20px; box-sizing: border-box; text-align: justify; line-height: 28px; color: rgb(51, 51, 51); font-variant-ligatures: normal; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">近几个月以来，中国资本掀起了海外收购足球俱乐部的狂潮，上一次较大的足球球队收购是8月13日IDG收购法甲里昂俱乐部20%股权，算上里昂，目前欧洲足球俱乐部已经有13家获得中国资本入股投资，其中包括为欧洲联赛传统豪门的曼城、马竞、AC米兰、国际米兰等。</p><p><br/></p>', 0, 1, '', '', '', '', '老牌英超豪门利物浦的美国老板已经聘请了经济顾问，认真考虑中国财团的收购报价。', '2016-08-22 14:25:53', '2016-08-22 15:59:29', '2016-08-22 14:22:41', 0, '晨哨网', '足球', 1, '/upload/newsthumb/2016-08-22/57ba9ac454a27.jpg', 0);
INSERT INTO `news` (`id`, `admin_id`, `admin_name`, `title`, `read_nums`, `praise_nums`, `comment_nums`, `cover`, `body`, `is_media`, `media_pos`, `video`, `video_cover`, `mp3`, `mp3_title`, `summary`, `create_time`, `update_time`, `publish_time`, `user_id`, `source`, `keywords`, `status`, `thumb`, `is_delete`) VALUES
(11, 2, '曹麦穗', '“深港通”开闸在即 公私募基金都在忙点啥？', 12, 2, 2, '/upload/newscover/2016-08-22/57ba9bf3dbb47.jpg', '<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; color: rgb(102, 102, 153);"><span style="box-sizing: border-box; font-weight: 700;">　　【核心提示】</span></span><span style="box-sizing: border-box; font-weight: 700;">一年时间转瞬即逝，港股的表现却已然是“冰火两重天”。就在去年8月份，中金公司发布了一篇研报，题目为《港股为何如此落寞：H股市场是否正在被边缘化》，报告一出，旋即引发市场热议。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-weight: 700;">　　彼时的港股市场，缺乏财富效应，不仅在此前的牛市行情中与A股表现相去甚远，在去年6月份以来A股大跌的波及下，H股同样大幅下挫，甚至几乎回吐了年初以来的所有收益，市场情绪异常低迷，“港股逐渐被边缘化”的声音和讨论不绝于耳。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-weight: 700;">　　而如今的港股市场，已然是另一番景象。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; text-align: center; background-color: rgb(255, 255, 255);"><img border="0" alt="" src="http://www.cnstock.com/image/201608/22/20160822074932134.jpg" style="box-sizing: border-box; border: 0px; vertical-align: bottom; max-width: 100%;"/></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　“先知先觉”的内地资金“南下”抢筹港股，国际资金近期也不断流入。公募基金大举布局沪港深基金，阳光私募更是纷纷在香港成立子公司并发行基金产品。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　更为重要的是，市场期待已久的深港通终于放行。有基金经理感慨，深港通对于A股市场的开放或许只是迈出了一小步，但对于港股市场而言则是一大步，港股的生态或许将就此改变。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在基金经理看来，港股不再只是主要针对海外投资者的“大洋”，而变为内地投资者和海外投资者共舞的“内海”。同时解决了投资者对港股的最大担忧——边缘化。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在资产荒愈演愈烈的当下，港股的高股息低估值的蓝筹股无疑具备更高的配置价值。一些基金经理认为，港股正处在企业ROE触底反弹带来的估值见底回升的过程中。在深港通的利好下，港股正在享受着历史性低估值反转的制度性红利。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-weight: 700;">　　港股迎来价值重估“新契机”</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　对于深港通的推出，业内有着很高的期待。港股有望迎来价值重估，几乎成为基金经理的一致预期。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　“深港通的推出不仅是沪港通简单的延续，也意味着内地资本市场对外开放的重启，香港资本市场重要战略作用重新得到高层的重视。”鹏华基金的基金经理陈龙如是表示。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在南方基金国际业务部负责人黄亮看来，深港通的开通对于香港市场具有非常正面的短期作用和长期意义。首先，拓展了之前沪港通中的港股范畴，使得内地投资者有更加全面的选择；其次，深港通的开通将为香港市场继续引入内地资金，相对的估值优势将成为资金的首选。内地资金的进入对于港股市场长期稳定发展具有积极意义；第三，深港通的开通对于A股市场全面开放也有着深远的意义，纳入世界主流股票指数的概率大大提升。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在负利率叠加资产荒的背景下，港股的高股息低估值的蓝筹股无疑具备更高的配置价值。招商基金国际业务部负责人白海峰认为，深港通开通之后，南下资金可利用港股的高票息特点，布局高票息策略，优势相对显著。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　白海峰举例说，港股通总市值千亿港元以上的个股近12个月平均股息率为3.61%，年初以来算术平均（即平均配置）的涨幅为6%，平均配置此类港股通资产具备一定债券属性。此外，随着负利率资产规模增加，债券收益率下行并不断创历史新低，高股息、低波动、有业绩的类固收金融资产价格即高分红蓝筹股会大概率跑赢基准，具有较好的投资价值。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　事实上，从基金公司上报的基金新产品来看，部分基金公司专门“瞄准”了港股中的高股息蓝筹股，例如平安大华上报了中证沪港深高股息精选指数型基金和高股息沪港深股票型两只基金。作为高股息蓝筹股的代表，汇丰控股近期连续刷新今年以来的反弹新高。美林美银近期上调了该股的评级，由“跑输大市”升至“买入”，其逻辑在于，汇丰控股近期宣布启动25亿美元回购股份计划，属意料之外，加之估计其通过调整美国业务可支持其2018年的派息。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　广发沪港深新机遇基金经理余昊也认为，在预期收益率普遍降低的背景下，通过配置权益类资产来提高收益率是一个可行的方向。在权益类资产的选择中，港股蓝筹较A股有较大的优势。余昊还认为，沪港通、深港通接连开通，使得港股对内地投资者全面开放，由于投资者结构的根本性改变，制度性的红利就是中长期港股估值体系将和A股趋近。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-weight: 700;">　　寄望打破A股“弱平衡”格局</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　谈及深港通对于A股市场的影响，部分投资者的理解是：深港通将使两个市场的估值水平趋于一致，这样对深市估值较高的中小板和创业板股不利，而对白酒、医药等消费股以及一些蓝筹股较为有利；此外，由于深港通会给券商带来更多业务，因而对证券行业是个利好。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　但在业内人士看来，上述论述也仅仅是一个表象的简单逻辑推导，实际运行结果也许并非如此。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　中航信托宏观策略总监吴照银表示，沪港通实施两年多了，沪港两市的估值水平仍未一致，甚至没有收敛，同一类型的公司两地估值仍有很大差异。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　值得注意的是，根据Wind数据统计，恒生AH股溢价指数自沪港通开通以来，溢价指数平均达131.99，相比未开通前两年的平均101.96，溢价指数还上升了29.45个百分点。在业内人士看来，AH股溢价率没有显著收敛主要由于两地投资者对股票估值的偏好不同，A股市场明显享有高估值待遇。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　“纠结于这一结构性的差异也许并不能完整理解在目前阶段推出深港通对股市的真正影响程度，比深港通本身带来的效用更重要的是它作为股市上涨的催化剂功能。”中航信托宏观策略总监吴照银表示，“过去半年来，A股市场波动非常小，多空力量较为平衡，但场外的流动性非常充裕，M1增速持续攀新高，资金利率不断下行，而股市的平衡却一直没有被打破。所以市场一直在寻找一个催化剂来打破这种平衡，引导流动性进入股市。现在深港通无疑充当了打破这一平衡的催化剂，带来股市向上突破。”</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　过去几天股市的强势上涨或许正是一些先知先觉的资金根据深港通预期提前进场造成的，吴照银预计，随着深港通的实施，场外资金有望继续入场。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　不过，在大成基金投研人士看来，短期A股市场流动性增加有限，其逻辑在于：一是深港通本身额度有限，北向每日额度130亿元人民币，南向每日额度105亿元；二是7月经济数据显示中国经济下行压力加大，整体环境并不好，A股市场吸引力有限。年初以来，深股通的标的深证成指走势表现也不如恒生指数，就估值而言，恒生小型指数估值大约20倍，但深证成指市盈率为35倍，两者之间估值差异较大；三是港股投资者结构中机构投资者占比较大，从2014年末统计数据来看，占比60%以上，其中外资占40%左右。基于调研的信息，港股机构投资者整体风格相对稳健，偏好于高股息低估值的蓝筹类股票，十分注意风险控制，对于参与A股市场持有相当谨慎的态度；四是从历史角度看，沪港通推出后带来的增量资金并不显著，截至8月16日收盘，沪股通额度累计使用1450亿元，不及额度上限（3000亿元）的一半，可以看出即使在取消总体额度限制的情况下，对市场流动性也没有大的影响。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　不过，深港通的推出有助于市场短期风险偏好的提升。大成基金表示：一是市场对场外资金流入的预期有所增强；二是基于历史的考虑，2014年沪港通的开通催化了A股上一轮牛市行情，虽然深港通对A股资金的实际影响十分有限，但从市场心理和行为角度考虑，短期对A股信心有提振作用，有助于提高交易活跃度，并推动市场的反弹行情。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-weight: 700;">　　公私募基金积极备战</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　近期港股市场表现十分强势，不断刷新年内新高。而部分“先知先觉”的基金提前大幅加仓港股，得以抢占港股市场反弹先机，基金净值表现亮眼。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　据Choice数据统计，最近三个月部分沪港深基金和布局了港股的QDII基金业绩表现相当亮眼。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　截至8月17日，共有10多只沪港深基金净值在近三个月时间涨幅超过10%，其中，华安沪港深外延增长基金近三个月净值上涨了19.06%，博时沪港深优质企业基金C近三个月净值上涨了18.2%，创金沪港深精选混合同期上涨了13.5%，前海开源沪港深蓝筹精选、景顺长城沪港深精选和富国沪港深价值精选同样表现不俗，净值分别上涨了13.34%、12.66%和12.47%。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　事实上，今年以来沪港深基金经历了集中扩容，截至8月18日，据Choice数据统计，市场上正在运作的沪港深基金共有33只，其中有8只成立于2015年，其余25只均集中在今年成立，此外还有1只处于募集状态。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　值得注意的是，8月以来又有多只沪港深基金获批发行。据证监会网站最新披露的信息显示，8月2日，前海开源沪港深新硬件主题获批发行，8月9日汇添富沪港深文体娱乐主题基金获批发行，8月11日，前海开源沪港深强国产业基金和前海开源沪港深乐享生活基金获批发行。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在众多的基金公司中，前海开源可谓是大手笔布局了沪港深基金。事实上，该公司此前已有11只沪港深混合型基金获批发行，加上近期又有3只获批发行，该公司的沪港深混合型基金有望达到14只。由此可见该公司对于此类基金的高度期待。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　此外，部分大中型私募基金也在积极探索布局“A+H”股的阳光私募产品。记者获悉，今年此类产品的港股仓位都有不同程度的提高，部分产品甚至主打H股投资，仓位配置达到了五成之上。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　值得注意的是，越来越多的超高净值客户意识到要站在全球的角度做资产配置。随着内地投资者海外配置需求的提升，一些大中型私募基金纷纷“扬帆出海”探索新业务。据悉，景林资产、淡水泉投资、赤子之心投资等早已布局海外业务，其中景林资产的海外产品规模已经突破300亿，且绝大多数为机构客户。今年以来，重阳投资、富善投资、望正资本等私募再一次掀起了出海热潮，纷纷在香港成立子公司并发行基金产品。</p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 25px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体, verdana, sans-serif; font-size: 18px; font-variant-ligatures: normal; line-height: 35px; orphans: 2; white-space: normal; widows: 2; background-color: rgb(255, 255, 255);">　　在一位私募基金的总经理看来，中国内地的资产管理机构应该参与到全球市场的竞争中去，中国内地资本要走向世界，海外资本也要进入中国内地，未来中国内地的资本跨境业务有望迎来爆发式增长机会。</p><p><br/></p>', 0, 1, '', '', '', '', '', '2016-08-22 14:31:39', '2016-08-23 09:37:18', '2016-08-22 14:26:57', 0, '中国证券网', '深港通', 1, '/upload/newsthumb/2016-08-22/57ba9bb93fb30.jpg', 0);
